import React, { Component } from "react";

class User extends Component {

  renderUsers = () => {
    return this.props.users.map(user => <br>{user.name}</br>)
  }

  render() {
    console.log(this.props)
    return (

      <div className='left-nav'>
        {console.log(this.renderUsers)}{this.renderUsers}
      </div>

    );
  };

}

export default User;
